document.getElementById('ta').onkeyup = function(e){
            var res = 'unchanged';
            if(this.oldValue !== this.value){
                this.oldValue = this.value;
				text=this.value;
                editorchange();
            }
            document.getElementById('ta').innerHTML = res;     
        };
		
function editorchange()
{
//document.getElementById('ta')
console.log(text);
print();

}
var avail_words;

var act_word;
var scrabbled_word;
var prev_word;
var hint_word;
var num;


String.prototype.shuffle = function () {
    var a = this.split(""),
        n = a.length;

    for(var i = n - 1; i > 0; i--) {
        var j = Math.floor(Math.random() * (i + 1));
        var tmp = a[i];
        a[i] = a[j];
        a[j] = tmp;
    }
    return a.join("");
}


var hintnum=0;
function hint()
{
hintnum++;
hint_word="";
var i;
for (i=0;i<hintnum;i++)
hint_word=hint_word+act_word[i];

for (;i<act_word.length;i++)
hint_word=hint_word+"_";
print();
}

function nextword()
{
hintnum=0;
console.log("next word");
prev_word=act_word;
num=Math.floor(Math.random()*avail_words.length );
act_word=avail_words[  num ];
hint_word="";
var i;
for (i=0;i<act_word.length;i++)
hint_word=hint_word+"_";

scrabbled_word=act_word.shuffle();
print();
}

function diff(a,b) //mi kellene a b-hez, hogy minden benne legyen, ami a-ban benne van.
{
function toar(q)
{
var ret=[];
var i;
for (i=0;i<q.length;i++)
ret.push(q[i]);
return ret;
}
var aa=toar(a);
var bb=toar(b);
var i,j;
for (i=0;i<bb.length;i++)
{
for (j=0;j<aa.length;j++)
{
if (bb[i]==aa[j]) {aa[j]=undefined;break;}
}

}
var ret="";
for (i=0;i<aa.length;i++)
if (aa[i]!=undefined) ret=ret+aa[i];
return ret;
}

function print()
{
var inhtml="prev_word:"+prev_word+"</br>scrabled_word:"+scrabbled_word+"</br>hint_word:"+
hint_word+"</br>freq num:"+num+
"</br>remaining characters:"+diff(scrabbled_word,text)+
"</br>shouldnt be used characters:"+diff(text,scrabbled_word)+
"</br>"+(act_word==text?"correct solution":"bad solution")
;
;
$( "#szo" ).html( inhtml );
}
